import React, { useState } from 'react'
import Button from 'react-bootstrap/Button'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import FormControl from '@mui/material/FormControl';
import Form from 'react-bootstrap/Form'

const HandleFeaturesDataToPredict = ({features, onSubmit}) => {
    const [textValue, setTextValue] = useState(null)
    const [textValueMessage, setTextValueMessage] = useState("")
    const [textValueError, setTextValueError] = useState(false)

    const handleSubmit = e => {
        console.log(e)
    }

    const handleTextChange = e => {
        setTextValue(e.target.value)
    }

    const handleTextFieldClick = e => {
        let featureChanged = e.target.labels[0].childNodes[0].data;
        //{currFeatureChanged: }

    }

    return (
        //<Container maxWidth='md' sx={{width: "90%"}}>
        <>
        <Form onClick={e => console.log(e.target)}>
            <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>Email address</Form.Label>
                <Form.Control type="email" placeholder="Enter email" />
                <Form.Text className="text-muted">
                We'll never share your email with anyone else.
                </Form.Text>
            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Password" />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicCheckbox">
                <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>
            <Button variant="primary" type="submit">
                Submit
            </Button>
        </Form>


        <Container>
            <FormControl onSubmit={handleSubmit}>
                <Grid container spacing={0}>
                    {features.map((feature, index) => 
                    <>
                        <Grid key={index} item xs={2}>
                            <TextField 
                                key={index} 
                                label={feature}
                                onChange={handleTextFieldClick}/>
                        </Grid>
                    </>
                    )}
                </Grid>

                <Button type="submit">click</Button>
            </FormControl>
        </Container>
        </>
    );
}

export default HandleFeaturesDataToPredict
